#1st map
check_row = 0
check_column = 0
poi_num,scan_num = 1,1
first_poiDone,second_poiDone,first_scanDone,second_scanDone = False,False,False,False
first_poi,second_poi,first_scan,second_scan = 0,0,0,0
for i in WORLD_MAP1:
    for j in i:
        if j == '2' or j == '3':
            if first_poiDone:
                second_poi = (check_row,check_column)
                second_poiDone = True
            else:
                first_poi = (check_row,check_column)
                first_poiDone = True
            if second_poiDone:
                POI_LIST.append((str(poi_num),(first_poi[0]*TILESIZE,second_poi[0]*TILESIZE),(first_poi[1]*TILESIZE,second_poi[1]*TILESIZE),'1'))
                POI_DICT[str(poi_num)] = True
                poi_num += 1
                
                first_poiDone,second_poiDone = False,False
        if j == '4' or j == '5':
            if first_scanDone:
                second_scan = (check_row,check_column)
                second_scanDone = True
            else:
                first_scan = (check_row,check_column)
                first_scanDone = True
            if second_scanDone:
                SCAN_LIST.append((str(scan_num),(first_scan[0]*TILESIZE,second_scan[0]*TILESIZE),(first_scan[1]*TILESIZE,second_scan[1]*TILESIZE),'1'))
